    "2015-01-07T18:35:26.527021",nt"name": "aerial-photography-and-imagery-ortho-corrected-montana-2013-naip-orthophotos1e7a8",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains imagery from the
    National Agriculture Imagery Program (NAIP). These data are digital aerial photos,
    at one meter resolution, of the entire state of Montana, taken in the year 2013.
    The data are available from the State Library in three different formats: The most
    accessible format is a downloadable collection of 698 compressed natural-color MrSID
    images, each 24 kilometers square. These images are in Montana State Plane coordinates,
    units meters. The web page for accessing these images is http://mslapps.mt.gov/Geographic_Information/Data/Aerial_Photos/naip_2013_default.aspx.
    The data are also downloadable as a collection of 56 compressed county mosaic (CCM)
    natural color MrSID images. These data are in UTM coordinates. The FTP folder containing
    these images is ftp://ftp.geoinfo.msl.mt.gov/Data/Spatial/MSDI/Imagery/2013_NAIP/UTM_County_Mosaics.
    The data are available from the State Library as a collection 11,776 4-band (near
    infrared, red, green and blue) TIFF images in UTM coordinates. Each image is about
    170 megabytes. The tiling format of the TIFF imagery is based on 3.75 x 3.75 minute
    quarter-quadrangles with a 300 pixel buffer on all four sides. An ESRI shapefile
    index showing the dates and times the images were acquired is available at ftp://ftp.geoinfo.msl.mt.gov/Data/Spatial/MSDI/Imagery/2013_NAIP/NAIP_2013_Dates.zip.
    An ESRI shapefile index showing the extent of the individual TIFF image files is
    available at ftp://ftp.geoinfo.msl.mt.gov/Data/Spatial/MSDI/Imagery/2013_NAIP/NAIP_2013_tiff_index.zip.
    To order TIFF images from the State Library, select the quadrangles you want from
    the tiff index shapefile and send them to the Library, along with a storage device
    of sufficient size to hold them and return postage for the device.",nt"license_title":
